@Ali_theCoder @_dotnetbot_ Expression tree lambdas are used mainly by data providers to translate C# to some query language.
Some C# features are meaningless to the data providers (e.g async/await), these features aren't supported by ET lambdas.
For the (?.) operator I guess it's just a missing feature.

